const landingPageStyle = {
    title: {
        marginTop: "30px",
        minHeight: "32px",
        color: "primary",
        textAlign: "center"
    },
    subtitle: {
        fontSize: "1.313rem",
        maxWidth: "500px",
        color: "secondary"
    },
    main: {
        marginTop: "100px",
        background: "#FFFFFF",
    },
    breadcrumbs: {
        background: 'primary'
    },
    img: {
        height: "350px",
        width: "350px",
        marginLeft: '25%'
    },
    img2: {
        height: "350px",
        width: "400px",
        marginLeft: '25%'
    },
    gif2: {
        marginLeft: '25%'
    }
};

export default landingPageStyle;
